    false,nt"url": null,nt"notes": "Data and information collected by the submersible
    Johnson Sea-Link II at waypoints along its track during thirteen of the fourteen
    dives of the 2004 "Estuary to the Abyss" expedition sponsored by the National
    Oceanic and Atmospheric Administration (NOAA) Office of Ocean Exploration, August
    20 through September 1, 2004. Measurements and information include sub's position
    and depth; personnel assignments; dive, mission, target, and vehicle ID's; dive
    comments; hyperlinks to CTD plots; water temperature; and salinity. The Marine Operations
    Division of the Harbor Branch Oceanographic Institution provided the original submersible
    data. Quality assurance included a comparsion and synchronization of dive log waypoint
    depths and CTD depths, review of minimum and maximum values, and deletion of bad
    values.",nt"owner_org": "9cda5205-d632-4814-96e7-a4ab5e0dce85",nt"extras":
